import http from '@core/services/http';
export default {
  /**
   * Sign up
   * @param payload
   * @return {*}
   */
  signIn: function signIn(payload) {
    return http.post('/auth/sign-in/v2', payload);
  },

  /**
   * Sign up
   * @param payload
   * @return {*}
   */
  signUp: function signUp(payload) {
    return http.post('/auth/sign-up/v2', {
      user: payload.user,
      shop_name: payload.shop_name
    });
  },
  forgot: function forgot(payload) {
    return http.post('/auth/forgot-password/v2', payload);
  },
  resetPass: function resetPass(payload) {
    return http.post('/auth/reset-password/v2', payload);
  },
  verifyEmail: function verifyEmail(payload) {
    return http.post('/auth/verify-email/v2', payload);
  },
  resendEmail: function resendEmail(payload) {
    return http.post('/auth/resend-email/v2', payload);
  }
};
